import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { FaHeart, FaLinkedin, FaGithub, FaFacebook, FaInstagram } from 'react-icons/fa';

const FooterContainer = styled.footer`
  background: linear-gradient(135deg, ${props => props.theme.colors.background.secondary} 0%, ${props => props.theme.colors.background.primary} 100%);
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  padding: 40px 0 20px;
  position: relative;
  overflow: hidden;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  text-align: center;
`;

const FooterContent = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 20px;
`;

const FooterText = styled.p`
  font-size: ${props => props.theme.fonts.sizes.base};
  color: ${props => props.theme.colors.text.secondary};
  margin: 0;
  line-height: 1.6;
`;

const HeartIcon = styled(FaHeart)`
  color: #ef4444;
  margin: 0 5px;
  animation: heartbeat 1.5s ease-in-out infinite;

  @keyframes heartbeat {
    0%, 100% {
      transform: scale(1);
    }
    50% {
      transform: scale(1.2);
    }
  }
`;

const SocialLinks = styled.div`
  display: flex;
  justify-content: center;
  gap: 20px;
  margin: 20px 0;
`;

const SocialLink = styled(motion.a)`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  background: linear-gradient(135deg, ${props => props.theme.colors.primary} 0%, ${props => props.theme.colors.secondary} 100%);
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 16px;
  text-decoration: none;
  transition: transform 0.3s ease, box-shadow 0.3s ease;

  &:hover {
    transform: translateY(-3px);
    box-shadow: 0 8px 20px rgba(14, 165, 233, 0.3);
  }
`;

const CopyrightText = styled.p`
  font-size: ${props => props.theme.fonts.sizes.sm};
  color: ${props => props.theme.colors.text.secondary};
  margin: 0;
  opacity: 0.8;
`;

const TechStack = styled.div`
  display: flex;
  justify-content: center;
  gap: 15px;
  margin: 20px 0;
  flex-wrap: wrap;
`;

const TechBadge = styled.span`
  background: rgba(14, 165, 233, 0.1);
  color: ${props => props.theme.colors.primary};
  padding: 6px 12px;
  border-radius: ${props => props.theme.borderRadius.full};
  font-size: ${props => props.theme.fonts.sizes.xs};
  border: 1px solid rgba(14, 165, 233, 0.2);
  font-weight: ${props => props.theme.fonts.weights.medium};
`;

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const socialLinks = [
    {
      icon: <FaLinkedin />,
      url: 'https://www.linkedin.com/in/omprakashutaha-b1815136/',
      label: 'LinkedIn'
    },
    {
      icon: <FaGithub />,
      url: 'https://github.com/OP3690',
      label: 'GitHub'
    },
    {
      icon: <FaFacebook />,
      url: 'https://www.facebook.com/global5665/',
      label: 'Facebook'
    },
    {
      icon: <FaInstagram />,
      url: 'https://www.instagram.com/omprakashutaha/',
      label: 'Instagram'
    }
  ];

  const techStack = [
    'React', 'Node.js', 'Python', 'JavaScript', 'SQL', 'Product Management'
  ];

  return (
    <FooterContainer>
      <Container>
        <FooterContent>
          <FooterText>
            Built with <HeartIcon /> by Omprakash Utaha
          </FooterText>

          <SocialLinks>
            {socialLinks.map((social, index) => (
              <SocialLink
                key={index}
                href={social.url}
                target="_blank"
                rel="noopener noreferrer"
                aria-label={social.label}
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                {social.icon}
              </SocialLink>
            ))}
          </SocialLinks>

          <TechStack>
            {techStack.map((tech, index) => (
              <TechBadge key={index}>{tech}</TechBadge>
            ))}
          </TechStack>

          <CopyrightText>
            © {currentYear} Omprakash Utaha. All rights reserved.
          </CopyrightText>
        </FooterContent>
      </Container>
    </FooterContainer>
  );
};

export default Footer;
